import React from 'react';
import { Link } from 'react-router-dom';
import '../pages/Css/App.css'; 

function App() {
  return (
    <div className="app-container">
      <h1 className="app-title">Medical Admin Panel</h1>
      <nav className="navigation-bar">
  <ul className="navigation-list">
    <li><Link to="/doctorlogin" className="nav-link">Doctor Login</Link></li>
    <li><Link to="/patientlogin" className="nav-link">Patient Login</Link></li>
    <li><Link to="/register" className="nav-link">Register</Link></li>
  </ul>
</nav>
<br></br>
<br></br>
<br></br>
<br></br>
<div class="typewriter-container">
At SANKET, we believe that communication should never be a <br></br>barrier to healthcare. That’s why we’ve created a platform designed to connect patients <br></br>and doctors in a way that’s inclusive, especially for individuals <br></br>who communicate using sign language.

Whether you're looking for a consultation, a follow-up, or <br></br>urgent medical advice, our system makes it easy for deaf and hard-of-hearing <br></br>individuals to communicate with doctors via video calls,<br></br> where sign language can be used seamlessly.
</div>
    </div>
   
  );
}

export default App;
